INSERT INTO CSM_PRIVILEGE (PRIVILEGE_ID,PRIVILEGE_NAME,PRIVILEGE_DESCRIPTION,UPDATE_DATE) VALUES (1,'CREATE','This privilege grants permission to a user to create an entity. This entity can be an object, a database entry, or a resource such as a network connection',to_date('2005-08-22','yyyy-mm-dd'));
INSERT INTO CSM_PRIVILEGE (PRIVILEGE_ID,PRIVILEGE_NAME,PRIVILEGE_DESCRIPTION,UPDATE_DATE) VALUES (2,'ACCESS','This privilege allows a user to access a particular resource.  Examples of resources include a network or database connection, socket, module of the application, or even the application itself',to_date('2005-08-22','yyyy-mm-dd'));
INSERT INTO CSM_PRIVILEGE (PRIVILEGE_ID,PRIVILEGE_NAME,PRIVILEGE_DESCRIPTION,UPDATE_DATE) VALUES (3,'READ','This privilege permits the user to read data from a file, URL, database, an object, etc. This can be used at an entity level signifying that the user is allowed to read data about a particular entry',to_date('2005-08-22','yyyy-mm-dd'));
INSERT INTO CSM_PRIVILEGE (PRIVILEGE_ID,PRIVILEGE_NAME,PRIVILEGE_DESCRIPTION,UPDATE_DATE) VALUES (4,'WRITE','This privilege allows a user to write data to a file, URL, database, an object, etc. This can be used at an entity level signifying that the user is allowed to write data about a particular entity',to_date('2005-08-22','yyyy-mm-dd'));
INSERT INTO CSM_PRIVILEGE (PRIVILEGE_ID,PRIVILEGE_NAME,PRIVILEGE_DESCRIPTION,UPDATE_DATE) VALUES (5,'UPDATE','This privilege grants permission at an entity level and signifies that the user is allowed to update data for a particular entity. Entities may include an object, object attribute, database row etc',to_date('2005-08-22','yyyy-mm-dd'));
INSERT INTO CSM_PRIVILEGE (PRIVILEGE_ID,PRIVILEGE_NAME,PRIVILEGE_DESCRIPTION,UPDATE_DATE) VALUES (6,'DELETE','This privilege permits a user to delete a logical entity. This entity can be an object, a database entry, a resource such as a network connection, etc',to_date('2005-08-22','yyyy-mm-dd'));
INSERT INTO CSM_PRIVILEGE (PRIVILEGE_ID,PRIVILEGE_NAME,PRIVILEGE_DESCRIPTION,UPDATE_DATE) VALUES (7,'EXECUTE','This privilege allows a user to execute a particular resource. The resource can be a method, function, behavior of the application, URL, button etc',to_date('2005-08-22','yyyy-mm-dd'));
INSERT INTO CSM_PRIVILEGE (PRIVILEGE_ID,PRIVILEGE_NAME,PRIVILEGE_DESCRIPTION,UPDATE_DATE) VALUES (8,'USE','This privilege allows a user to use a particular resource',to_date('2005-08-22','yyyy-mm-dd'));
INSERT INTO CSM_PRIVILEGE (PRIVILEGE_ID,PRIVILEGE_NAME,PRIVILEGE_DESCRIPTION,UPDATE_DATE) VALUES (9,'ASSIGN_READ','This privilege allows a user to assign a read privilege to others',to_date('2005-08-22','yyyy-mm-dd'));
INSERT INTO CSM_PRIVILEGE (PRIVILEGE_ID,PRIVILEGE_NAME,PRIVILEGE_DESCRIPTION,UPDATE_DATE) VALUES (10,'ASSIGN_USE','This privilege allows a user to assign a use privilege to others',to_date('2005-08-22','yyyy-mm-dd'));
INSERT INTO CSM_PRIVILEGE (PRIVILEGE_ID,PRIVILEGE_NAME,PRIVILEGE_DESCRIPTION,UPDATE_DATE) VALUES (11,'IDENTIFIED_DATA_ACCESS','This privilege allows a user to view identified data of an object',to_date('2005-08-22','yyyy-mm-dd'));
INSERT INTO CSM_PRIVILEGE (PRIVILEGE_ID,PRIVILEGE_NAME,PRIVILEGE_DESCRIPTION,UPDATE_DATE) VALUES (12,'READ_DENIED','This privilege doesnt permit the user to read data',to_date('2005-08-22','yyyy-mm-dd'));
